import React, { Fragment } from 'react';
import { Row, Col } from 'react-bootstrap'


const Home_Body = () => {
    return (
        <Fragment fluid>
            <Row className="show-grid">
                <Col xs={6} md={3}>
                    side menu
                </Col>
                <Col x={12} md={9}>
                    company component
                    company info
                </Col>
            </Row>
        </Fragment>
    )
};

export default Home_Body;
